import {makeStyles} from '@material-ui/core'

const FormStyle = makeStyles((theme)=>({
    container:{
        display:'flex',
        flexDirection:'row',
        justifyContent:'center'
    },
    form:{
        display:'flex',
        flexDirection:'column',
        alignItems:'center'
    }
}))

export default FormStyle
